import React from "react";

const User = () => {

    

  return (
    <>
      <div className="app">
        <h2>User:</h2>

        <ul className="layout">
          {user.map((item) => (
            <li>
              <div className="profile">
                <img src={item.avatar}></img>
              </div>
              <div className="innerDetl">
                <p className="name">
                  Name : {item.first_name} {item.last_name}
                </p>
                <p className="email">Email : {item.email}</p>
                <p className="phone">ID : {item.id}</p>
              </div>
            </li>
          ))}
        </ul>
      </div>
    </>
  );
};

export default User;
